import React, { useState, useEffect } from "react";
import  { Redirect } from 'react-router-dom'

const Home = () => {
   const [isLogin,setIsLogin] = useState(true);
   useEffect(() => {
      setIsLogin(true)
    }, []);
   if(isLogin){
      return (
         <div className="login-page">
               <header className="login-header">
                  <h1> HOME </h1>
               </header>
         </div>
       );
   }else{
      return (<Redirect to = "/login"/>)
   }
   
}

export default Home;
